import React from "react";

const NamedExport = () => {
    return (<div>
        <h1>Main Menu</h1>
        <p>Fidget toys are directly below. </p>
        <p> Click "Call API" to insert how many cat facts you would like and view them. </p>
        <p> Click "Spotify Auth" to connect your account.</p>
    </div> );
};

export { NamedExport };
